(function($){
	$.fn.fadeable = function(options){		
		var settings = {
			target: this,
			duration: 'fast'
		};
		$.extend(settings, options)		
		$(this).on('hover', function(event) {
			switch(event.type){
				case 'mouseenter':
					$(this).find(settings.target).stop().fadeTo(settings.duration,1);
					break;
				case 'mouseleave':
					$(this).find(settings.target).stop().fadeTo(settings.duration,0);
					break;
			}
		});
	}
})(jQuery);
(function($) {
  $.fn.fullBg = function(){
    var bgImg = $(this);		
 
    function resizeImg(show) {
      var imgwidth = bgImg.width();
      var imgheight = bgImg.height();
 
      var winwidth = $(window).width();
      var winheight = $(window).height();
 
      var widthratio = winwidth / imgwidth;
      var heightratio = winheight / imgheight;
 
      var widthdiff = heightratio * imgwidth;
      var heightdiff = widthratio * imgheight;
 
      if(heightdiff>winheight) {
        bgImg.css({
          width: winwidth+'px',
          height: heightdiff+'px'
        });
      } else {
        bgImg.css({
          width: widthdiff+'px',
          height: winheight+'px'
        });		
      }
      if(show){bgImg.fadeTo('slow',1);}
    } 
    resizeImg(true);
    $(window).resize(function() {
      resizeImg();
    }); 
  };
})(jQuery);
